import { Routes, Route } from 'react-router-dom';

//Import Routes


import {HomePage, ConceptsPage} from '../views/index';

const Home = <Route path="/" element={<HomePage/>}/>;
const Contents = <Route path='/contents/' element={<ConceptsPage/>}/>
const Error_404 = <Route path="*" element={<h1>ERROR 404 No se encuentra el documento</h1>}/>

const RoutesPag = ()=>{
    return(
            <Routes>
                <Home/>
                <Contents/>
                <Error_404/>
            </Routes>
    );
};

export {
    RoutesPag as PagApp
}
